import Router from 'next/router';
import axios from 'axios';
import { GET_DATA_SERVER, GET_DATA_CLIENT } from '../types/types';
import firebase from '../../lib/database/index'

export const getDataClient = () => (dispatch) => {
  axios.get(`https://firestore.googleapis.com/v1/projects/paw-centre
  /databases/(default)/documents/products/
  `)
}
